column41:
On the Acc1 I ordered for the cable customer 234973241, osf order id 864783.

Clickflow:
 * Load the customer
 * Open the existing KIP package
 * Select a new KIP tariff, e. g.: 2BV:DG3
 * Open the existing TV package of the custmer
 * Go through the checkout & order

The order that was sent to VkdGateway contained some very wrong contents, apparently somewhere in Omnius/OGW the contents of the KIP serviceLine were simply copied into the TV serviceLine:
{code:json}
             "serviceLines": [
                {
                    "processContext": "ILSBLU",
                    "category": "KIP",
                    "orderLineId": "1003062986",
                    "serviceLineId": "KIP",
                    "products": [
                        {
                            "productId": "1BV:B09",
