{code}
I have seen the error message caused by such failing orders ("Product selection failure: Service line category 'TV' and service category 'KAV' combination for item") many times in production by now, and there are many cases per day (on some days >30), so I believe this is not a one time error.

On the Acc2 the issue could also be reproduced for the same customer id, osf order id: 1111103

