column930:
22/Mar/23 11:16 PM;bas.smeets@vodafone.com;RCA:

As part of implementation of Z_SRT02126640A(enhancements in plm process logging) a check was added that based on logfile name it was determined if we are in a auto-import scenario. This was not a correct implementation since for auto import we are triggering the plm.php job with stack=Auto. Then after checking the files which are missing we are internally triggering the process again with i.e. stack=Mobile ( incase mobile is missing). The name of the logfile doesnt change, this resulted in attempting to do the autoimport file comparison again, however this time it fails since we didnt retrieve the files. Hence the autoimport fails.

TLDR: Z_SRT02126640A broke it.;;;

